INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "東山奈央", 16, "人助け、応援", 0, 2, 27, "トゥインクルウィッシュ", "人助けが大好き！　前向き格闘娘", 44, 100101, "ヒヨリ", "獣人族", 8, 155, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "種田梨沙", 17, "料理、人間観察", 0, 2, 5, "トゥインクルウィッシュ", "戦闘のサポートが得意な、心優しい少女", 47, 100201, "ユイ", "ヒューマン", 4, 158, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("B", "早見沙織", 18, "読書、乗馬、お茶", 0, 2, 12, "トゥインクルウィッシュ", "クールで何事にも真っ直ぐな剣士", 46, 100301, "レイ", "魔族", 1, 163, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "諸星すみれ", 9, "いたずら、探検", 0, 5, 10, "リトルリリカル", "探検好きのイタズラっ子", 27, 100401, "ミソギ", "ヒューマン", 8, 128, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "下田麻美", 12, "ヒーローごっこ", 0, 8, 25, "王宮騎士団（NIGHTMARE）", "ヒーローに憧れる騎士見習いの少女", 40, 100501, "マツリ", "獣人族", 11, 146, "？？？");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "浅倉杏美", 13, "サックス", 0, 7, 22, "悪魔偽王国軍（ディアボロス）", "甘え上手なみんなの人気者", 42, 100601, "アカリ", "魔族", 11, 150, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("B", "雨宮天", 14, "プリンを食べること", 0, 7, 23, "悪魔偽王国軍（ディアボロス）", "プリン大好きゴースト娘", 32, 100701, "ミヤコ", "魔族", 1, 130, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("AB", "大空直美", 14, "鏡で自分を見ること", 0, 15, 10, "ヴァイスフリューゲル　ランドソル支部", "ボクは誰よりも美しい", 40, 100801, "ユキ", "エルフ", 10, 150, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "髙野麻美", 17, "小説執筆", 0, 13, 5, "トワイライトキャラバン", "前世を信じる中二病患者、「疾風の冥姫」", 45, 100901, "アンナ", "魔族", 7, 159, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "内田真礼", 16, "空想、ぬいぐるみ集め", 0, 10, 22, "自警団（カォン）", "マホマホ王国のプリンセス", 42, 101001, "マホ", "獣人族", 9, 155, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "阿澄佳奈", 15, "お裁縫", 0, 3, 25, "ラビリンス", "人懐っこくてマシンガントークな妹系少女", 44, 101101, "リノ", "ヒューマン", 8, 156, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "大橋彩香", 17, "妹と遊ぶこと、二度寝、昼寝、早寝", 0, 6, 24, "フォレスティエ", "みんなのために超能力を使う眠り姫", 46, 101201, "ハツネ", "エルフ", 12, 156, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！");
