INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "上坂すみれ", 18, "ファッション", 0, 14, 10, "ルーセント学院", "天真爛漫で人気者のカリスマモデル", 48, 101601, "スズナ", "魔族", 4, 167, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "高森奈津美", 19, "踊り、空手", 0, 10, 7, "自警団（カォン）", "いつでも「なんくるないさ～」な天然娘", 53, 101701, "カオリ", "獣人族", 7, 158, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("B", "伊藤静", 23, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 0, 14, 14, "ルーセント学院", "多くの男性を魅了する無垢な女教師", 52, 101801, "イオ", "魔族", 8, 162, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "日高里菜", 10, "かわいいもの集め", 0, 5, 3, "リトルリリカル", "お歌もにんじんも、ウサギさんも大好き♪", 21, 102001, "ミミ", "獣人族", 4, 117, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("B", "植田佳奈", 12, "観劇、おままごと", 0, 9, 9, "サレンディア救護院", "泣き虫で臆病な守ってあげたい女の子", 40, 102101, "クルミ", "ヒューマン", 6, 150, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "原紗友里", 13, "ゲーム全般", 0, 7, 22, "悪魔偽王国軍（ディアボロス）", "人見知りであまのじゃくな女の子", 40, 102201, "ヨリ", "魔族", 11, 150, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("B", "芹澤優", 14, "屋内でできる遊び", 0, 9, 10, "サレンディア救護院", "ぷうきちといつも一緒！", 38, 102301, "アヤネ", "ヒューマン", 5, 148, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "悠木碧", 15, "ご奉仕", 0, 9, 12, "サレンディア救護院", "お嬢さまのためにがんばるドジっ娘メイド", 43, 102501, "スズメ", "ヒューマン", 12, 154, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("B", "小岩井ことり", 17, "あんパン", 0, 11, 1, "牧場（エリザベスパーク）", "遊びと睡眠が何より大事なぐうたら娘", 42, 102601, "リン", "獣人族", 1, 144, "test");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("B", "橋本ちなみ", 16, "実験、裁縫、料理", 0, 13, 30, "トワイライトキャラバン", "運命の相手に一途すぎる乙女", 43, 102701, "エリコ", "魔族", 7, 154, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "堀江由衣", 17, "経営、お茶会", 0, 9, 4, "サレンディア救護院", "救護院を経営する優しい庶民派お嬢様", 43, 102801, "サレン", "エルフ", 10, 156, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("B", "日笠陽子", 17, "舞台鑑賞、ダンス", 0, 4, 24, "カルミナ", "歌って踊れる大人気アイドル", 40, 102901, "ノゾミ", "ヒューマン", 1, 157, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "佐藤聡美", 16, "忍法開発", 0, 15, 31, "ヴァイスフリューゲル　ランドソル支部", "トーゴクの神秘、オシエテクダサイ！", 51, 103001, "ニノン", "ヒューマン", 8, 163, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("AB", "大坪由佳", 18, "占い", 0, 7, 22, "悪魔偽王国軍（ディアボロス）", "占いが得意な霊能少女", 42, 103101, "シノブ", "魔族", 12, 157, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("AB", "松嵜麗", 18, "慈善事業", 0, 12, 12, "メルクリウス財団", "一人前の商人を目指すパワフルお嬢様", 45, 103201, "アキノ", "ヒューマン", 3, 157, "この私とともにいる限り、\nお金に不自由はさせませんわ！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("B", "新田恵海", 20, "漫才", 0, 11, 3, "牧場（エリザベスパーク）", "みんなを笑顔にするお笑い牧場主", 35, 103301, "マヒル", "ヒューマン", 3, 142, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "今井麻美", 22, "ウインドーショッピング", 0, 12, 16, "メルクリウス財団", "純情でほっとけない大人の女性", 55, 103401, "ユカリ", "エルフ", 3, 164, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "小倉唯", 8, "お勉強", 0, 5, 2, "リトルリリカル", "礼儀正しくしっかり者のちびっ子優等生", 21, 103601, "キョウカ", "エルフ", 2, 118, "test");
