INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "小清水亜美", 14, "読書、お散歩", 0, 11, 3, "牧場（エリザベスパーク）", "読書が趣味の病弱少女", 40, 103801, "シオリ", "獣人族", 11, 153, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("AB", "花澤香菜", 13, "友達作りのイメトレ", 0, 6, 6, "フォレスティエ", "「友達」に憧れる、エルフの森の女の子", 44, 104001, "アオイ", "エルフ", 6, 158, "友達ができるその日まで…\nBB団で\nトレーニングですっ！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "福原綾香", 17, "各種楽器", 0, 4, 3, "カルミナ", "人々を守るために歌う、唱喚士の少女", 46, 104201, "チカ", "ヒューマン", 6, 163, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…");
