INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "丹下桜", "??", "世界征服", 0, 7, 5, "悪魔偽王国軍（ディアボロス）", "かつては夜を支配した最強の吸血鬼", 50, 104401, "イリヤ", "魔族", 5, 172, "test");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("AB", "長妻樹里", 18, "小説を読むこと", 0, 15, 19, "ヴァイスフリューゲル　ランドソル支部", "妄想大好き！　ほんとは照れ屋な女の子", 49, 104501, "クウカ", "ヒューマン", 11, 157, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("AB", "沼倉愛美", 18, "猫とたわむれること", 0, 12, 1, "メルクリウス財団", "弱きを助け強きをくじく猫娘", 48, 104601, "タマキ", "獣人族", 3, 158, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪");
