INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "生天目仁美", 18, "家事全般", 0, 3, 24, "ラビリンス", "お姉ちゃんがお世話してあげるからねっ！", 54, 104901, "シズル", "ヒューマン", 10, 168, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！");
