INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "久野美咲", 11, "ファッション誌鑑賞、コスメ集め", 0, 14, 3, "ルーセント学院", "ちょっとおませな恋に恋する女の子", 22, 108301, "ミサキ（ハロウィン）", "魔族", 1, 120, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("O", "福原綾香", 17, "各種楽器", 0, 4, 3, "カルミナ", "人々を守るために歌う、唱喚士の少女", 46, 108401, "チカ（クリスマス）", "ヒューマン", 6, 163, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("B", "植田佳奈", 12, "観劇、おままごと", 0, 9, 9, "サレンディア救護院", "泣き虫で臆病な守ってあげたい女の子", 40, 108501, "クルミ（クリスマス）", "ヒューマン", 6, 150, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("B", "芹澤優", 14, "屋内でできる遊び", 0, 9, 10, "サレンディア救護院", "ぷうきちといつも一緒！", 38, 108601, "アヤネ（クリスマス）", "ヒューマン", 5, 148, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("A", "東山奈央", 16, "人助け、応援", 0, 2, 27, "トゥインクルウィッシュ", "人助けが大好き！　前向き格闘娘", 44, 108701, "ヒヨリ（ニューイヤー）", "獣人族", 8, 155, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
